import React from 'react';

function App() {
    return (
        <div>
            {/* Пример за произволно React съдържание, което се показва под vanilla UI */}
            <section style={{ padding: '20px', backgroundColor: 'rgba(255, 255, 255, 0.8)' }}>
                <h2>React-компонент: Последни транзакции</h2>
                <p>Тук можеш да добавиш графики, списък с транзакции или всякакви други React функционалности.</p>
            </section>
        </div>
    );
}

export default App;
